  data and information collected during the EX1605L3 (CAPSTONE CNMI & Mariana Trench
  MNM (ROV & Mapping)) on NOAA Ship OKEANOS EXPLORER in the North Pacific Ocean from
  2016-06-17 to 2016-07-10 (NCEI Accession 0156334)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-09-05T23:39:18.765020\",\n\t\"name\": \"ex1605l3-ncei-accession-0156334\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains oceanographic data
  collected in the deep water areas around the Commonwealth of the Northern Marianas
  Islands (CNMI). Operations for this cruise included ROV, mapping, telepresence-based
  remote participation, and CTD rosette operations. Operations also used the shipu00e2u0080u0099s
  deep water mapping systems, NOAAu00e2u0080u0099s two-body 6000 m remotely operated
  vehicle, and the shipu00e2u0080u0099s high-bandwidth satellite connection for real-time
  ship to shore communications. Daytime ROV dives were planned every day and included
  high-resolution visual surveys and limited rock and biologic specimen sampling.
  Mapping operations were conducted overnight when the ROV was on deck and CTD casts
  were taken to collect more environmental information at sites of interest. Exploration
  operations for this cruise focused on deep-water areas around CNMI and the Marianas
  Trench Marine National Monument (MTMNM). This expedition helped establish a baseline
  of information in the region to catalyze further exploration, research, and management
  activities.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
